import React,{Component} from 'react';


class Header extends Component
{
    render() {
        return(<div style={HeaderStyle}><h2>Railway Reservation System</h2></div>);
    }
}

const HeaderStyle={
    positon:'fixed',
    background:'LightGrey',
    width:'1190px',

    textAlign:'center',
    border: '3px solid Black'
};

export default Header;
